nodejs amqp client: amqplib

```
var amqp = require('amqplib/callback_api');
function listen() {
        amqp.connect("amqp://" +
            $config.get("mq.username") + ":" + $config.get("mq.password") +
            "@" + $config.get("mq.host") + ":" + $config.get("mq.port"),
            function (err, conn) {
                if (err == null) {
                    console.log("connected to message server!");
                    conn.createChannel(function (err, ch) {
                        var ex = $config.get("mq.exchange");
                        ch.assertExchange(ex, 'topic', { durable: false });
                        ch.assertQueue('', { exclusive: true }, function (err, q) {
                            ch.prefetch(50);
                            ch.bindQueue(q.queue, ex, "data.*.*");
                            ch.consume(q.queue, function (msg) {
                                // on message
                                console.log(msg.fields.routingKey, msg.content.toString());
                                ch.ack(msg);
                            });
                        });
                    });
                } else {
                    console.log("cannot connect to message server!", err);
                }
            }
        );
    }

